	props.reversed = reversed;
	cjs.MovieClip.apply(this,[props]);

	// timeline functions:
	this.frame_0 = function() {
		var root = this;
		var i = 0;
		var j = 0;
		var speed = 80;
		var txt = String(this.txt_mundo_p1.text);
		this.txt_mundo_p1.text= "";
		this.btn_play_luna.visible = false;
		
		var txt2 = String(this.txt_mundo_p2.text);
		this.txt_mundo_p2.text= "";
		
		function typeWriterPart1(callback) {
		  if (i < txt.length) {
		    root.txt_mundo_p1.text += txt.charAt(i);
		    i++;
		    setTimeout(typeWriterPart1, speed, callback);
		  }
		  if (i === txt.length){
		            callback();
		  }
		}
		
		function typeWriterPart2() {
		  if (j < txt2.length) {
		    root.txt_mundo_p2.text += txt2.charAt(j);
		    j++;
		    setTimeout(typeWriterPart2, speed);
		  }
		  if (j === txt2.length){
			root.btn_play_luna.visible = true;
			//this.stop();
		  }
		}
		
		typeWriterPart1(typeWriterPart2);
		
		this.btn_play_luna.on("click", irATres.bind(this));
		
		function irATres(e) {
			this.parent.parent.cambiarEscenario(new lib.mc_escenario3());
		}
	}
